import React from 'react';
import { createBrowserRouter, RouterProvider } from "react-router-dom";

const body = () => {
  const appRouter = createBrowserRouter([
    {
      path:"/",
      element:<login />
    },
    {
      path:"/browse",
      element:<browse />
    }
  ])

  return (
    <div>
      <RouterProvider router={appRouter} />
    </div>
  )
}

export default body;
